interface Event {
    id: number;
    text: string;
    date: string;
}


const Events = (events: { id: number; text: string; date: string; }) => {

    return (
        <>
            {events.map((event:object) => (
                <h3 key={event.id}>{event.text}</h3>
            ))}
        </>
    )
}


export default Events
